import React from 'react';
import './Header.css';
import model3d from '../assets/final_island_2.glb'

function Header() {
	return (
		<header>
			<model-viewer alt="3d model" src={model3d} camera-controls disable-zoom interpolationDecay={200}></model-viewer>

			<div class="demo" style={{background: 'linear-gradient(#ffffff, #ada996)', overflowX: 'hidden',}}>

				<span style={{position: 'absolute', textAlign: 'left', fontSize: '200px', left: '50%'}}>TEAM TREES</span>

				<model-viewer alt="3d model" src={model3d} camera-controls disable-zoom interpolationDecay={200}></model-viewer>
			</div>

		</header>
	);
}

export default Header;
